INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 1, 0, 0, 19814, 11, 10, 103011, "このおいしそうなケーキは……ハッ！？\nワタシの命を狙う、アクダイカンの\n仕組んだトラップでショウか？", 0.5, 19814071);
