INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 1, 0, 0, 26224, 11, 10, 101411, "わっ、これは随分と豪華なケーキだね。\nふむ……今日、ケーキを準備して誰かを\n待ち、そして後から呼ばれたのは……\nこの推理だと、わ、私のためかい？", 0.5, 26224063);
