INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 1, 0, 0, 31114, 11, 10, 100711, "それならプリンがいいの～！\nこのケーキと同じくらい、でっかい\nプリンが食べたいの～！", 0.5, 31114076);
