INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 1, 0, 0, 32314, 11, 10, 101611, "ミサキっち、ホントおめでと～！\nとりま、飲み物はコーヒーでよさげ？\nお店で大人っぽい味でよろ～って\n頼んだら、おに苦くされたけど！", 0.5, 32314063);
