INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 1, 0, 0, 34314, 11, 10, 100711, "オマエたち、よくわかってるプレゼント\n本当にありがとうなの～♪\n次から誕生日だけじゃなくて、\nお盆と命日にもプリンを寄こすの～", 0.5, 34314081);
