INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 1, 0, 0, 34414, 11, 10, 102911, "みんな、今日は私の誕生日を\nお祝いしてくれてありがとう♪\nこういう時って、やっぱりバースデー\nライブとかした方がいいのかな？", 0.5, 34414058);
