INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (1, 1, 0, 0, 34414, 11, 10, 104211, "楽しそうではありますが……\nよく考えたら、お祝いされる方が\n歌って踊るというのも\n不思議な話ではありますね。", 0.5, 34414063);
